import styled, {keyframes} from 'styled-components';


export const InputClassic = styled.input`
  background-color: white;
  border-color:black;
  color:white;
  font-family: Orbitron , sans-serif;
  font-size: 50px;
  text-shadow: 1px 1px 10px white;
  text-align:center;
  outline:none;
  width:100%;
`
